import AddStudent from './components/AddStudent'
import Header from './components/Header'
import { StudentItem } from './components/StudentItem'

function App() {
  return (
    <div className="App">
      <Header/>
      <AddStudent/>
      <StudentItem studentDescription='opis' studentName='Jan Kowalski' studentTags='tag1'/>
    </div>
  );
}

export default App;
